import Table from 'react-bootstrap/Table';

const TableData = ({data = []}) => {
    return (
        <>
            <Table striped>
                <thead>
                    <tr>
                        <th>Name</th>
                        <th>Amount</th>
                        <th>Time</th>
                        <th>Discription</th>
                    </tr>
                </thead>
                <tbody>
                    {
                        data?.map((value, key) => {
                            return (
                                <tr key={key}>
                                    <td>{value.name}</td>
                                    <td>{value.amount}</td>
                                    <td>{value.time}</td>
                                    <td>{value.discription}</td>
                                </tr>
                            )
                        })
                    }
                </tbody>
            </Table>
        </>
    );
}

export default TableData;
